import Brazil from "../../brazil.jpg";
import Eyebrow from "../../eyebrow.jpg";

function Waxing() {
  return (
    <div className="cards">
      <h1>Beauty Queen Wax Treatments</h1>
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items">
            <CardItem
              src={Wax}
              text="Silky smoother legs"
              price="30Mins - Â£30"
